import React from 'react';

import About from './About';
import Notes from './Notes';
import Store from '../Store';
import { observer } from 'mobx-react';

@observer
class Main extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      Store.page === 'about' ? <About /> : <Notes />
    );
  }
}

export default Main;
